import React,{useState} from 'react';
import './App.css';
import './lit.css'

function Room() {

  const [isLit,setLit]=useState(false);


  return (

    <div className='room' >
      this room is lit{isLit? 'lit' : 'dark'}<br />
    <button onClick={()=>setLit(!isLit)}>Flip</button>

    </div>



  );
}

export default Room;
